const DiaryItem = (id, emotion, content, date) => {
  const env = process.env;
  env.PUBLIC_URL = env.PUBLIC_URL || "";
  console.log(id.emotion);
  return (
    <div className="DiaryItem">
      <div
        className={[
          "emotion_img_wrapper",
          `emotion_img_wrapper_${id.emotion}`,
        ].join(" ")}
      >
        <img
          src={process.env.PUBLIC_URL + `assets/emotion${id.emotion}.png`}
          alt={`emotion${id.emotion}`}
        />
      </div>
      <div className="info_wrapper">
        <div className="diary_data"></div>
        <div className="diary_content_preview"></div>
      </div>
    </div>
  );
};
export default DiaryItem;
